import "./styles.css";
import { useEffect, useState } from "react";

export default function ListingAd({flag, arrow_left, arrow_right, price,icon, pic, title, address, description ,availabilities_label, subprice_label,project_type,year,ownership_type }) {
  // Show description on first render for SEO; hide after mount until clicked
  const [isMounted, setIsMounted] = useState(false);
  const [openDesc, setOpenDesc] = useState(false);
  useEffect(() => { setIsMounted(true); }, []);
  const showDescription = isMounted ? openDesc : true;

  // Click-to-reveal phone numbers: show "dddd XXXX" until clicked
  const PhoneNumber = ({ raw, display }) => {
    const [revealed, setRevealed] = useState(false);
    const masked = `${raw.slice(0, 4)} XXXX`;
    return (
      <span className="phoneToken" onClick={() => setRevealed(true)}>
        {revealed ? display : masked}
      </span>
    );
  };

  // Render description with line breaks and phone tokens
  const renderDescription = (text) => {
    const lineBreaks = text.split(/\r?\n/);
    const phoneRe = /(?:\+65[-\s]?)?([3689]\d{3})[-\s]?(\d{4})/g; // SG 8-digit (+ optional +65)
    return lineBreaks.map((line, li) => {
      const parts = [];
      let last = 0;
      let m;
      while ((m = phoneRe.exec(line)) !== null) {
        const start = m.index;
        if (start > last) parts.push(line.slice(last, start));
        const raw = `${m[1]}${m[2]}`;
        const display = `${m[1]} ${m[2]}`;
        parts.push(<PhoneNumber key={`ph-${li}-${start}`} raw={raw} display={display} />);
        last = phoneRe.lastIndex;
      }
      if (last < line.length) parts.push(line.slice(last));
      return (
        <span key={`line-${li}`}>
          {parts}
          {li < lineBreaks.length - 1 ? <br /> : null}
        </span>
      );
    });
  };

  return (
    <div className={`App ${showDescription ? "hasDescOpen" : ""}`}>
      <div className="imageContainer">
        {flag && <img className="flag" src={flag} alt="Flag" />}
        <img className="mainPic" src={pic} alt={title} />
        
        <button className="arrowBtn arrowLeft">
          <img src={arrow_left} alt="Previous" />
        </button>
        <button className="arrowBtn arrowRight">
          <img src={arrow_right} alt="Next" />
        </button>
      </div>
      <div className="mainContent">
        <div className="topContent">
            <div className="leftContent">
              <div className="leftTopContent">
                <img className="icon" width="40" height="40" src={icon}/>
                  <div className="textLeftTopContent">
                    <h1 className="title">{title}</h1>
                    <p className="address">{address}</p>
                  </div>
              </div>
              <div className="leftBotContent">
                <p className="labelTop">{project_type} · {year} · {ownership_type}</p>
                <p className="labelBot">{availabilities_label}</p>
              </div>
            </div>

            <div className="rightContent">
              <div className="price">
                <h1>{price}</h1>
              </div>
              <p className="priceFrom">{subprice_label}</p>
            </div>
        </div>

        <div className="bottomContent">
          <button
            aria-expanded={showDescription}
            aria-controls="listing-description"
            onClick={() => setOpenDesc(v => !v)}
          >
            {showDescription ? "Hide description" : "See description"}
          </button>
          {showDescription && (
            <div id="listing-description" className="descriptionBox">
              {renderDescription(description)}
            </div>
          )}
        </div>

      </div>
    </div>
  );
}
